class AssetAttachmentsModelClass {  String? tenantId;  String? assetId;  String? description;  List<String>? attachments;  AssetAttachmentsModelClass(      {this.tenantId, this.assetId, this.description, this.attachments});  AssetAttachmentsModelClass.fromJson(Map<String, dynamic> json) {    tenantId = json['tenantId'];    assetId = json['assetId'];    description = json['description'];    attachments = json['attachments'].cast<String>();  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['tenantId'] = tenantId;    data['assetId'] = assetId;    data['description'] = description;    data['attachments'] = attachments;    return data;  }}